BIAbooks is an off-shoot of Business Information Associates. We are a family owned, independent online bookstore. Established in 2006, BIAbooks has been providing great books to booklovers around the world. Our book inventory represents the best of contemporary books. We specialize in hardcover Modern First Editions.

Condition and quality of our books is of upmost importance to us. We acquire mostly FINE graded books. If not Fine then we take pains to describe the condition.

Customer Service is paramount to us. Our customer rating is Excellent ( 5 stars), as determined by Abebooks and Biblio.


Our inventory  includes the following book categories:: 

New Books;
Gently Used books;
Signed books;
Rare books;
Prize winning books;
First editions;
Debut books;
Memoirs;
Autobiography;
Biography;
Fiction;
Science fiction;
Short stories;
Poetry.
